import './App.css';
import LoginPage from './LoginPage';
import SignupPage from './SignupPage';
import { BrowserRouter, Route, Switch, Router } from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
      <Route path="/LoginPage">
          <LoginPage />
        </Route>
        <Route path="/SignupPage">
          <SignupPage />
        </Route>
      </Switch>
    </Router>

  );
}

export default App;
